  box-sizing: border-box;
`;

function App() {
  return (
    <AppTotal>
   <CardTermo/>
        <CardTemp/>
        <LeftColumn>

      </LeftColumn>
      <RightColumn>
<CardP/>
<Card/>
<Modo/>
  </RightColumn>
    </AppTotal>
  );
}

export default App;
